tables.table_schema:
CREATE TABLE parking_spaces (
  space_id INT PRIMARY KEY,
  location VARCHAR(255),
  availability BOOLEAN,
  permit_id INT REFERENCES parking_permits(permit_id)
);

CREATE TABLE parking_permits (
    permit_id UUID PRIMARY KEY,
    car_owner_id UUID NOT NULL,
    parking_spot_number INT NOT NULL,
    expiration_date DATE
);

CREATE TABLE cars (
    car_id UUID PRIMARY KEY,
    car_model VARCHAR(50) NOT NULL,
    car_color VARCHAR(20) NOT NULL,
    car_owner_id UUID NOT NULL
);

CREATE TABLE parking_spots (
    spot_number INT PRIMARY KEY,
    status VARCHAR(10) NOT NULL,
    vehicle_id UUID
);

CREATE TABLE ParkingLots (
    lot_id INT PRIMARY KEY,
    lot_name VARCHAR(50),
    lot_capacity INT,
    lot_manager VARCHAR(50)
);

CREATE TABLE permits (
  permit_id SERIAL PRIMARY KEY,
  vehicle_id INT NOT NULL,
  start_date DATE NOT NULL,
  expiration_date DATE NOT NULL
);

CREATE TABLE vehicles (
  vehicle_id SERIAL PRIMARY KEY,
  make VARCHAR(50) NOT NULL,
  model VARCHAR(50) NOT NULL,
  year INT NOT NULL
);

CREATE TABLE parking_spaces (
  space_id SERIAL PRIMARY KEY,
  location VARCHAR(100) NOT NULL,
  capacity INT NOT NULL
);

CREATE TABLE parking_assignments (
  assignment_id SERIAL PRIMARY KEY,
  permit_id INT NOT NULL,
  space_id INT NOT NULL
);

CREATE TABLE parking_logs (
  log_id SERIAL PRIMARY KEY,
  permit_id INT NOT NULL,
  space_id INT NOT NULL,
  log_date TIMESTAMP NOT NULL
);
